  true,\n\t\"url\": null,\n\t\"notes\": \"Case studies illustrate the kinds of decisions
  and dilemmas managers face every day, and as such provide an effective learning
  tool for project management. Due to the dynamic and complex environment of projects,
  a great deal of project management knowledge is tacit and hard to formalize. A case
  study captures the complex nature of a project and identifies key decision points,
  allowing the reader an inside look at the project from a practitioneru2019s point
  of view.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
